 (16,'http://www.businesstimes.com.sg/banking-finance/dbs-hires-rabobanks-shome-as-india-ceo','www.businesstimes.com.sg','','','DBS hires Rabobank\'s Shome as India CEO, Banking & Finance - THE BUSINESS TIMES','DBS hires Rabobank\'s Shome as India CEO, Banking & Finance - THE BUSINESS TIMES','2015-02-28 08:00:00','0','0','news','','0','http://www.businesstimes.com.sg/sites/all/themes/custom/businesstimes/images/BTflipboard2.jpg','DBS hires Rabobank\'s Shome as India CEO He will replace Sanjiv Bhasin from April 15; appointment comes after surge in soured debt; 28 Feb 5:50 AM \nMumbai \nDBS Group Holdings Ltd has hired Rabobank NA\'s Surojit Shome to replace Sanjiv Bhasin as head of its Indian operations after a surge in soured debt. Mr Shome, who was Rabobank\'s India chief executive officer and country head, will join DBS as CEO of its Indian business effective '),
 (17,'http://economictimes.indiatimes.com/industry/banking/finance/sanjiv-bhasin-quits-as-dbs-india-head/articleshow/46405265.cms','economictimes.indiatimes.com','http://economictimes.indiatimes.com/industry/industry/banking/finance/industry/banking/finance/rssfeeds/13358311.cms','Finance-Banking/Finance-Industry-The Economic Times','Sanjiv Bhasin quits as DBS India head','Sanjiv Bhasin quits as DBS India head','2015-02-28 13:14:00','0','0','blogs','IL','0','http://economictimes.indiatimes.com/thumb/msid-46405340,width-310,resizemode-4/sanjiv-bhasin-quits-as-dbs-india-head.jpg','Sanjiv Bhasin quits as DBS India head By ET Bureau | 28 Feb, 2015, 10.44AM IST What\'s buzzing hot on Budget 2015? Check out our in-depth coverage DBS India head Sanjiv Bhasin has resigned for personal reasons and will be replaced by Surojit Shome, who quit as chief executive of Rabobank earlier this month. Bhasin, who turned 60 this month, plans to pursue different interests, Singapore headquartered DBS Bank said in a statement on Friday. His seven-year stint will end on June 30, it added. \"Shome, CEO and country head of Rabobank India, will assume the role of CEO of DBS India with effect from April 15,\" the bank said. DBS Group Holdings, Southeast Asia\'s largest lender, posted its lowest quarterly profit at the end of December 2014 in more than two years, as trading income slumped and provisions for bad loans increased. The bank, which has 12 branches in the country, has seen a 46% dip in profits to Rs 299.2 crore at the end of March 2014 compared with Rs 554.5 crore last year. The bank\'s stressed assets in the small and medium enterprises business has led to a steep rise in its bad loans. Non-performing loans of the bank more than doubled to 10.19% at the end of March 2014 compared with 2.37% last year. Shome, who has worked with Lehman Brothers and Citigroup, faces the challenge of cleaning up DBS\' India book and bring growth back to the balance sheet. Globally, investors and shareholders are increasingly becoming intolerant towards bank managements and boards, with depressed profitability following slowdown in growth markets like India. On Thursday, London-headquartered Asia centric Standard Chartered saw a management reshuffle with the exit of Peter Sands, its chief executive officer, and Asia head Jaspal Bindra. Bill Winters, a former JPMorgan Chase investment banker, was appointed the new chief executive of the UK bank. DON\'T MISS any stories, follow us on Twitter Follow'),
 (18,'https://www.prbuzz.com/business-entrepreneur/292763-rupiah-set-for-longest-losing-streak-since-2013-after-rate-cut-indonesia-currency.html','www.prbuzz.com','https://www.prbuzz.com/business-entrepreneur.html','Business','Rupiah Set For Longest Losing Streak Since 2013 After Rate Cut: Indonesia Currency','Rupiah Set For Longest Losing Streak Since 2013 After Rate Cut: Indonesia Currency','2015-02-27 08:00:00','0','1','news','US','0','','JAKARTA, February 27, 2015â€”Indonesiaâ€™s rupiah was set to drop for a fourth month, the longest losing streak since 2013, after the central bank signaled it will tolerate a weaker currency.\nBank Indonesia unexpectedly lowered its benchmark interest rate to 7.5% from 7.75% on February 17. The authority said it expects a current-account deficit of 3% to 3.1% of gross domestic product this year, compared with 2.95% in 2014, and the currencyâ€™s movement is â€œbeneficialâ€ in damping imports and improving export competitiveness.\nThe rupiah weakened 1.6% in February to 12,870 a dollar as of 10:32 a.m. in Jakarta Friday, prices from local banks show. The currency declined 0.2% today, extending its loss in the past four months to 6.1%. The Bloomberg Dollar Spot Index, which trackâ€™s the greenbackâ€™s performance against 10 major peers, advanced for an eighth month.\nâ€œThe surprise rate cut, in addition to broad-based dollar strength, impacted the rupiah,â€ said Gundy Cahyadi, an economist at DBS Group Holdings Ltd. in Singapore. â€œWe expect the central bank to maintain tight monetary policy while tolerating more weakness in line with other currencies.â€\nOne-month non-deliverable forwards fell 1.1% in February to IDR12,982 a dollar, data compiled by Bloomberg show.\nGlobal funds added IDR7.5 trillion (US$582 million) to local-currency sovereign debt holdings this month through February 25, following an outflow of IDR39.5 trillion in January, Finance Ministry data show.\nGovernment bonds due September 2025 advanced for a second month, with the yield slipping 13 basis points, or 0.13 percentage point, to 7.04%, according to prices from the Inter Dealer Market Association. Thatâ€™s the lowest level since February 3. It fell six basis points Friday and 17 this week. Read more ...'),
 (19,'http://singaporestockmarketnews.blogspot.com/2015/02/banyan-tree-holdings-2015-turnaround.html','singaporestockmarketnews.blogspot.com','http://feeds.feedburner.com/blogspot/wKTe','Singapore Stock Market News','Banyan Tree Holdings - 2015 a turnaround year','Banyan Tree Holdings - 2015 a turnaround year','2015-02-28 16:14:00','0','1','blogs','US','0','','Home Â» Banyan Tree Holdings , Hospitality Sector Â» Banyan Tree Holdings - 2015 a turnaround year Banyan Tree Holdings - 2015 a turnaround year Shared By Stock Fanatic on Saturday, February 28, 2015 | 28.2.15 â–  FY14 turns in a marginal profit â–  Locked-in profits from property sales underpins earnings visibility in 2015 â–  Maintain BUY, TP S$0.70 Highlights Profitable end to 2014 amid operational difficulties â–  Banyan Tree (BTH) booked S$4.1m PATMI in 4Q14 (+13% y-o-y) and a 6% rise in operating profit (EBITDA) to S$19.9m . This was mainly boosted by revaluation gains from the Seychelles resorts. Stripping out those gains, BTH would be in the red. Topline shrank y-o-y due to lower comtribution from the hotel investment segment and feebased income (design fees). On full year basis, the group turned in a marginal profit of S$1.0m, missing our estimate. Hotel operations affected by slow European market â–  4Q14 revenues dipped 5% y-o-y mainly due to weaker performance of its resorts in Phuket, Maldives and Seychelles, as a result of fewer visitors from Europe and Russia (weak ruble). Thailand operations were also hurt by the unrest in early 2014, but picked up towards year end. Revenues from hotel investments fell 8% y-o-y. Property sales remained stable â–  Property sales grew 11% y-o-y largely due to the recognition of close to 20 units of Laguna â€“branded/Banyan Tree branded holiday homes and residences vs 8 units a year ago. For the full year, total sales edged down because of fewer Laguna Holiday Club memberships sold. Outlook Strong property sales â–  The group sold 164 new units in 2014 vs 163 the year before . This implies 2% increase units sold and 15% increase in value. New units sold were mainly at newly launched Cassia Phuket/Bintan and Laguna Park holiday homes. Total unrecognised revenues amounted to S$110m, the bulk of which would be recognised in 2015. In addition, its new property launch in Chengdu saw good take-up and saw pre-launch booking deposits for 151 units at Wenjiang, implying 71% sell-through rate. Outlook for Hotel division remains challenging â–  Forward bookings for owned hotels in the groupâ€™s network of resorts are 7% lower than last year (6% lower for Thailand resorts; 10% lower for ex-Thailand). This is mainly due to the weak sentiment in Europe and Russia (sharp depreciation of the ruble). However, the group will focus on marketing its product and brand to Chinese tourists, which have been increasing in recent years. Technical Analysis Daily Chart Valuation â–  Given the distinct business segments, we believe it appropriate to value Banyan Tree using the sum-of-the-part method . Our TP of S$0.70 is based on (i) revised 12x EV/EBITDA for the hotel business (due to uncertain outlook), and (ii) present value of locked-in profits at the property development arm at cost. We are retaining our BUY rating for more than 20% upside . Risks Seasonality in travel patterns result in earnings volatility â–  Given the seasonality of the resort business, Banyan Tree earnings is volatile and dependent on the performance of its peak travel periods (4Q-1Q) of each year . Thus any events that affect travel demand within the peak holiday season will have an impact on earnings. Political risks â–  The group derives a substantial portion of revenues/assets from Thailand . The ongoing political stalemate in Bangkok has resulted in travel advisories against travel into Thailand and thus has impacted performance negatively. Interest rate risk â–  Interest rate hikes will have an impact on earnings once it refinances its loans . However, this is mitigated by the group having a fairly conservative net debt/equity of 0.4x as of 4Q13 and fixing a portion of its loan on fixed rates. ( Read Report ) Source : DBS Group Research'),
 (20,'http://singaporestockmarketnews.blogspot.com/2015/02/pan-united-corporation-soft-outlook.html','singaporestockmarketnews.blogspot.com','http://feeds.feedburner.com/blogspot/wKTe','Singapore Stock Market News','Pan-United Corporation - Soft outlook ahead','Pan-United Corporation - Soft outlook ahead','2015-02-28 14:25:00','0','1','blogs','US','0','','Home Â» Construction Sector , Pan-United Corp Â» Pan-United Corporation - Soft outlook ahead Pan-United Corporation - Soft outlook ahead Shared By Stock Fanatic on Saturday, February 28, 2015 | 28.2.15 â–  4Q14/FY14 results disappointed on lower RMC margins and higher costs â–  Final DPS of 2.75 Scts declared â–  Cut FY15/16F earnings by 28%/36% â–  Stock supported by 5% dividend yield, maintain HOLD with lower S$0.85 TP Below expectations 4Q14 earnings of S$4m (-70% y-o-y) was significantly below our estimate of S$10m . While FY14 revenue (S$763m, +5% y-o-y) was within expectations, margins declined due to higher than expected raw material, labour and subcontracting costs, which led to full year earnings declining by 27% y-o-y to S$32.4m. On a positive note, CCIP port broke even earlier than expected, contributing to 32% (S$13m) earnings increase for the Port business in FY14. Pan-United declared a final DPS of 2.75 Scts, bringing full year DPS to 4.25 Scts (75% dividend payout) . Bleak BBM outlook Outlook for Ready mixed concrete segment is not expected to be rosy with ready mixed concrete (RMC) volume demand expected to be stable, but at softer ASPs. Along with higher cost structure, we believe profitability will be weak over the horizon. Factor lower BBM margins going forward. We anticipate high cost structure to sustain and expect low margins for BBM going forward. We reduce EBIT margins for BBM but expect improvements in CXP/CCIP port on stronger cargo volumes. These adjustments resulted in FY15/16F earnings cuts of 28%/36%. Technical Analysis Daily Chart Maintain HOLD, TP reduced to S$0.85 The stock is currently supported by a dividend yield of 5% . Even though we have cut earnings, we do not see much downside to the stock since DPS for FY15F (projected to be 4.25 Scts) should be sustainable. However, we are not positive on the stock due to the weak outlook for the BBM segment. Maintain HOLD with a lower SOTP-based TP of S$0.85 . ( Read Report ) Source : DBS Group Research'),
